    const [street, setStreet] = useState('');
    const [building, setBuilding] = useState(3);
    const [immediateBuy, setImmediateBuy] = useState(40);

    function inputHeader(text) {
        return (
            <h2 className="text-2xl mt-4">{text}</h2>
        );
    }
